import React from 'react';
import {Row, Col, Container} from 'react-bootstrap';
import './sidebar.css';
import '../../custom.scss';

function Example() {
  return (
        <Container fluid>
            <Row className='base'>
                <Col md={{ span: 4}} className="sidebar"/>
                <Col className="main"/>
            </Row>
            
        </Container>
    )
}

export default Example;
